import React from "react";
import '../styles/dashboard.css'
import { Container , Row ,Col} from 'reactstrap';


const Dashboard = () => {
    return (
        <Container>
            <Row>
                <Col lg='6'>
                    <h3>User Details : </h3>
                    <h5></h5>
                </Col>
            </Row>
        </Container>
    )
}

export default Dashboard;
